import Select from 'react-select';



export function MultiSelectCity() {
    const options = [
        { value: '1', label: 'M체nchen' },
        { value: '2', label: 'Stuttgart' },
        { value: '3', label: 'Mannheim' }
    ];
    return (
        <Select isMulti name="Ort ausw채hlen"
            options={options}
            className="basic-multi-select min-w-40 w-full"
            classNamePrefix="select"
            placeholder="Ort ausw채hlen"
        />
    );
}
